import React from "react";
import axios from "axios";

class App extends React.Component {
  state = {
    users: [],
    username: "",
    email: "",
  };

  componentDidMount = () => {
    this.getBlogPost();
  };

  getBlogPost = () => {
    axios
      .get("/api")
      .then((response) => {
        const data = response.data;
        this.setState({ data: [...this.state.users] });
        console.log("Data has been recieved");
        console.log(data);
      })
      .catch(() => {
        alert("Error retriving data");
      });
  };
  displayLogPost = (users) => {
    if (!users.lenght) return null;
  };

  render() {
    const {users} = this.state;
    return (
      <div className="das">
        {/* {this.displayLogPost(this.state.users)}
         */}
        {users.map((user, index) => (
          <div key={index}>
            <h1>{this.state.users[0].username}</h1>
            <p>{user.email}</p>
          </div>
        ))}
      </div>
    );
  }
}
export default App;
